import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import { waynedahlberg } from "@/authors";
import image1 from "./IMG_0045.jpg";
import image2 from "./IMG_0643.jpg";
export const meta = {
  title: `Dome Motor & Holoprojectors`,
  description: `New deliveries`,
  date: "2016-06-23T14:24:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Today the Pittman drive motor showed up. It’s 24/12 VDC with a 19.7:1 gear ratio. It’s high torque, high speed, and going to do a great job spinning R2’s head around in circles. I’ll stash it away until I’m able to source a CS:R frame, which from the sound of it will be this fall.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
